const Memes = ({memes}) => {
  const allMemes = memes.map(meme => {
    return (
      <div key={meme.id} className="bg-gray-200 border border-gray-400 rounded-lg shadow-lg p-6 mt-4">
        <p className="text-gray-900 font-bold mb-2">Title: {meme.title}</p>
        <p className="text-gray-900 font-bold mb-2">Punchline: {meme.message}</p>
      </div>
    );
  });

  return (
    <div className="mt-10 pb-20">
      {allMemes}
    </div>
  );
};

export default Memes;
